animal.description:
A couple wanted to rehome this beautiful, blue-eyed boy due to the wife's having several cats and a bad back. He is afraid of large dogs, or other dogs, due to formerly being attacked by a Mastiff once. He needs a time to warm up to new people and friendly dogs, so he needs a calm, quiet household in which to learn to trust again and get used to a loving, new home. He'd likely be best as an only dog, as anything new seems to scare him. ..So, this handsome boy needs someone patient and understanding.
NO CHILDREN OR SMALL ANIMALS;
FENCED YARD REQUIRED.
